window.bookSummaryJSON = "<p><b>A </b><b><i>New York Times</i></b><b> best seller! </b></p> <p><b><i>Cruel Prince</i></b><b> meets </b><b><i>A Court of Thorns and Roses</i></b><b> in this sexy, action-packed fantasy about a girl who is caught between two treacherous faerie courts and their dangerously seductive princes.</b></p> <p>Brie hates the Fae and refuses to have anything to do with them, even if that means starving on the street. But when her sister is sold to the sadistic king of the Unseelie court to pay a debt, she'll do whatever it takes to get her backâ€”including making a deal with the king himself to steal three magical relics from the Seelie court.</p> <p>Gaining unfettered access to the Seelie court is easier said than done. Brie's only choice is to pose as a potential bride for Prince Ronan, and she soon finds herself falling for him. Unwilling to let her heart distract her, she accepts help from a band of Unseelie misfits with their own secret agenda. As Brie spends time with their mysterious leader, Finn, she struggles to resist his seductive charm.</p> <p>Caught between two dangerous courts, Brie must decide who to trust with her loyalty. And with her heart.</p>"; 
